import express from 'express'
import fs from 'fs'

const app = express()

app.get('/', (req,res) => {
    console.log(req.headers["accept-language"] )
    fs.readFile('./public/index.html', (err, data) => {
        if(err && err !== null)
            res.send('Error getting the page\n' + err.message)
        else
            res.send(data.toString())
    })
})

app.listen(8080, () => {
    console.log('Up & listening')
})

